pub enum ErrorKind {
    Msg(String),
    CircularExtend {
        tpl: String,
        inheritance_chain: Vec<String>,
    },
    MissingParent {
        current: String,
        parent: String,
    },
    TemplateNotFound(String),
    FilterNotFound(String),
    TestNotFound(String),
    InvalidMacroDefinition(String),
    FunctionNotFound(String),
    Json(serde_json::Error),
    CallFunction(String),
    CallFilter(String),
    CallTest(String),
    Io(std::io::ErrorKind),
    Utf8Conversion {
        context: String,
    },
    __Nonexhaustive,
}
